INSERT INTO `resources` VALUES ('0','Printer.Start',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- \n    Openbravo POS is a point of sales application designed for touch screens.\n    Copyright (C) 2008-2009 Openbravo, S.L.\n    http://sourceforge.net/projects/openbravopos\n\n    This file is part of Openbravo POS.\n\n    Openbravo POS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    Openbravo POS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with Openbravo POS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n\n<output>\n    <display animation=\"scroll\">\n        <line>\n            <text>Openbravo POS</text>\n        </line>\n        <line>\n            <text>   Welcome   </text>\n        </line>\n    </display>\n</output>\n'),('1','Printer.Ticket',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<!--\r\n    Openbravo POS is a point of sales application designed for touch screens.\r\n    Copyright (C) 2007-2009 Openbravo, S.L.\r\n    http://sourceforge.net/projects/openbravopos\r\n\r\n    This file is part of Openbravo POS.\r\n\r\n    Openbravo POS is free software: you can redistribute it and/or modify\r\n    it under the terms of the GNU General Public License as published by\r\n    the Free Software Foundation, either version 3 of the License, or\r\n    (at your option) any later version.\r\n\r\n    Openbravo POS is distributed in the hope that it will be useful,\r\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\r\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\r\n    GNU General Public License for more details.\r\n\r\n    You should have received a copy of the GNU General Public License\r\n    along with Openbravo POS.  If not, see <http://www.gnu.org/licenses/>.\r\n -->\r\n<output>\r\n\r\n    <ticket>\r\n       <line></line>\r\n	<line>\r\n\r\n            <text align=\"center\" length=\"12\">${ticket.printSysDate()}</text>\r\n	    <text length=\"5\" align=\"left\"></text>\r\n            <text length=\"6\" align=\"center\">${ticket.printTime()}</text>\r\n            <text length=\"30\" align=\"left\"></text>\r\n  	    <text align=\"left\" length=\"12\">${ticket.printShowDate()}</text>\r\n            <text align=\"center\" length=\"12\">${showinfo.printStarttime()}</text>\r\n        </line>\r\n  	<line></line>\r\n<line></line>\r\n        <line>\r\n\r\n            <text align =\"left\" length=\"25\" >Ticket Category</text>\r\n	    <text length=\"15\" align=\"left\"></text>\r\n            <text align =\"left\" length=\"10\">Seats</text>\r\n            <text align =\"right\" length=\"29\">Price</text>\r\n        </line>\r\n\r\n        #foreach ($ticketline in $ticket.getLines())\r\n\r\n        <line>\r\n\r\n            #if ($ticketline.isProductCom())\r\n                <text align =\"left\" length=\"25\">*${ticketline.printName()}</text>\r\n            #else\r\n                <text align =\"left\" length=\"25\">${ticketline.printName()}</text>\r\n            #end\r\n	    <text length=\"15\" align=\"left\"></text>\r\n            <text align =\"left\" length=\"10\">${ticketline.printMultiply()}</text>\r\n            <text align =\"right\" length=\"29\">${ticketline.printSubValue()}</text>\r\n        </line>\r\n        #if ($ticketline.productAttSetInstId)\r\n        <line>\r\n	        <text align =\"left\" length=\"42\">${ticketline.productAttSetInstDesc}</text>\r\n        </line>\r\n        #end\r\n        #end\r\n        <line>\r\n            <text align =\"left\" length=\"25\" bold=\"true\">Total.</text>\r\n            <text length=\"15\" align=\"left\"></text>\r\n            <text align =\"left\" length=\"10\">${ticket.printArticlesCount()}</text>\r\n            <text align =\"right\" length=\"29\" bold=\"true\">${ticket.printTotal()}</text>\r\n        </line>\r\n	<line></line>\r\n    #if ($announcement.getAnnouncement())\r\n 	<line>\r\n\r\n            <text align =\"left\" length=\"75\" bold=\"true\">${announcement.printAnnouceFirstLine()}</text>\r\n        </line>\r\n	<line>\r\n           <text align =\"left\" length=\"75\" bold=\"true\">${announcement.printAnnouceSecondLine()}</text>\r\n        </line>\r\n     #end\r\n\r\n    </ticket>\r\n    #foreach ($paymentline in $ticket.payments)\r\n     #if ($paymentline.name == \"cash\")\r\n    <opendrawer/>\r\n     #end\r\n     #if ($paymentline.name == \"cashrefund\")\r\n    <opendrawer/>\r\n     #end\r\n    #end\r\n</output>\r\n'),('10','Window.Title',0,'Openbravo POS is a point of sale designed for touch screens.'),('11','Ticket.Buttons',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- \n    Openbravo POS is a point of sales application designed for touch screens.\n    Copyright (C) 2008-2009 Openbravo, S.L.\n    http://sourceforge.net/projects/openbravopos\n\n    This file is part of Openbravo POS.\n\n    Openbravo POS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    Openbravo POS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with Openbravo POS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n<configuration>\n    <button key=\"button.print\" titlekey=\"button.print\" template=\"Printer.TicketPreview\"/>\n    <button key=\"button.opendrawer\" titlekey=\"button.opendrawer\" template=\"Printer.OpenDrawer\"/>\n    <event key=\"ticket.change\" code=\"Code.ReceiptConsolidate\"/>\n    <!-- <event key=\"ticket.change\" code=\"event.change\"/> -->\n    <!-- <event key=\"ticket.addline\" code=\"event.addline\"/> -->\n    <!-- <event key=\"ticket.removeline\" code=\"event.removeline\"/> -->\n    <!-- <event key=\"ticket.setline\" code=\"event.setline\"/> -->\n    <!-- <event key=\"ticket.show\" code=\"event.show\"/> -->\n    <!-- <event key=\"ticket.total\" code=\"event.total\"/> -->\n    <!-- <event key=\"ticket.close\" code=\"event.close\"/> -->   \n    <img-width value=\"64\"/>\n    <img-height value=\"54\"/>\n    <cat-height value=\"300\" />\n    <taxesincluded value=\"false\"/>   \n    <!-- <printselected value=\"true\"/> -->    \n    <!-- <taxcategoryid value=\"001\"/> -->\n    <!-- <pricevisible value=\"true\" /> -->\n</configuration>\n'),('12','Ticket.Line',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!--\n    Openbravo POS is a point of sales application designed for touch screens.\n    Copyright (C) 2007-2009 Openbravo, S.L.\n    http://sourceforge.net/projects/openbravopos\n\n    This file is part of Openbravo POS.\n\n    Openbravo POS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    Openbravo POS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with Openbravo POS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n\n<line>\n    <column name=\"label.item\" width=\"125\" align=\"left\" value=\"${ticketline.printName()}\"/>\n    <column name=\"label.units\" width=\"50\" align=\"center\" value=\"${ticketline.printMultiply()}\"/>\n    <column name=\"label.price\" width=\"80\" align=\"right\" value=\"${ticketline.printSubValue()}\"/>\n\n</line>'),('13','Printer.Inventory',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- \n    Openbravo POS is a point of sales application designed for touch screens.\n    Copyright (C) 2008-2009 Openbravo, S.L.\n    http://sourceforge.net/projects/openbravopos\n\n    This file is part of Openbravo POS.\n\n    Openbravo POS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    Openbravo POS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with Openbravo POS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n<output>\n    <ticket>\n        <image>Printer.Ticket.Logo</image>\n        <line></line>\n        <line>\n            <text align=\"center\" length=\"42\">Receipt sample.</text>\n        </line>\n        <line>\n            <text align=\"center\" length=\"42\">You can change this template</text>\n        </line>\n        <line>\n            <text align=\"center\" length=\"42\">in the resources panel</text>\n        </line>\n        <line></line>\n        <line>\n            <text>Date:     ${inventoryrecord.printDate()}</text>\n        </line>\n        <line>\n            <text>Reason:   ${inventoryrecord.printReason()}</text>\n        </line>\n        <line>\n            <text>Location: ${inventoryrecord.printLocation()}</text>\n        </line>\n        <line size=\"1\">\n            #if ($inventoryrecord.isInput())\n            <text align =\"center\" length=\"42\">In</text>\n            #else\n            <text align =\"center\" length=\"42\">Out</text>\n            #end\n        </line>\n        <line></line>    \n        <line>\n            <text align =\"left\" length=\"17\">Item</text>\n            <text align =\"right\" length=\"10\">Price</text>\n            <text align =\"right\" length=\"5\"></text>\n            <text align =\"right\" length=\"10\">Value</text>\n        </line>      \n        <line>\n            <text>------------------------------------------</text>\n        </line>   \n        #foreach ($inventoryline in $inventoryrecord.getLines())\n        <line>\n            <text align =\"left\" length=\"17\">${inventoryline.printName()}</text>\n            <text align =\"right\" length=\"10\">${inventoryline.printPrice()}</text>\n            <text align =\"right\" length=\"5\">x${inventoryline.printMultiply()}</text>\n            <text align =\"right\" length=\"10\">${inventoryline.printSubValue()}</text>\n        </line> \n        #if ($inventoryline.productAttSetInstId)\n        <line>\n	        <text align =\"left\" length=\"42\">    ${inventoryline.productAttSetInstDesc}</text>\n        </line>\n        #end\n        #end\n        <line>\n            <text>------------------------------------------</text>\n        </line>   \n        <line></line>            \n        <line>\n            <text align=\"center\" length=\"42\">Thank you for your visit.</text>\n        </line>   \n    </ticket>\n</output>'),('14','Menu.Root',0,'//    Openbravo POS is a point of sales application designed for touch screens.\n//    Copyright (C) 2007-2009 Openbravo, S.L.\n//    http://sourceforge.net/projects/openbravopos\n//\n//    This file is part of Openbravo POS.\n//\n//    Openbravo POS is free software: you can redistribute it and/or modify\n//    it under the terms of the GNU General Public License as published by\n//    the Free Software Foundation, either version 3 of the License, or\n//    (at your option) any later version.\n//\n//    Openbravo POS is distributed in the hope that it will be useful,\n//    but WITHOUT ANY WARRANTY; without even the implied warranty of\n//    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n//    GNU General Public License for more details.\n//\n//    You should have received a copy of the GNU General Public License\n//    along with Openbravo POS.  If not, see <http://www.gnu.org/licenses/>.\n\n    group = menu.addGroup(\"Menu.Main\");\n    group.addPanel(\"/com/openbravo/images/mycomputer.png\", \"Menu.Ticketing\", \"com.openbravo.pos.sales.JPanelTicketSales\");\n\n\n    group = menu.addGroup(\"Menu.Backoffice\");\n    group.addPanel(\"/com/openbravo/images/bookmark.png\", \"Menu.TicketCategory\", \"com.openbravo.pos.panels.JPanelTicketCategory\");\n    group.addPanel(\"/com/openbravo/images/mycomputer.png\", \"Menu.TicketRefund\", \"com.openbravo.pos.sales.JPanelTicketEdits\");\n    group.addPanel(\"/com/openbravo/images/kdmconfig.png\", \"Menu.Users\", \"com.openbravo.pos.admin.PeoplePanel\");\n    group.addPanel(\"/com/openbravo/images/yast_group_add.png\", \"Menu.Roles\", \"com.openbravo.pos.admin.RolesPanel\");\n    group.addPanel(\"/com/openbravo/images/yast_group_add.png\", \"Menu.Holiday\", \"com.openbravo.pos.panels.JPanelHoliday\");\n    group.addPanel(\"/com/openbravo/images/yast_group_add.png\", \"Menu.Show\", \"com.openbravo.pos.panels.JPanelShow\");\n    group.addPanel(\"/com/openbravo/images/yast_group_add.png\", \"Menu.Extended\", \"com.openbravo.pos.panels.JPanelSeats\");\n    group.addPanel(\"/com/openbravo/images/yast_group_add.png\", \"Menu.Announcement\", \"com.openbravo.pos.panels.JPanelAnnouncement\");\n    group.addPanel(\"/com/openbravo/images/yast_group_add.png\", \"Menu.CancelFee\", \"com.openbravo.pos.panels.JPanelCancel\");\n    group.addPanel(\"/com/openbravo/images/yast_group_add.png\", \"Menu.Discount\", \"com.openbravo.pos.panels.JPanelDiscount\");\n    submenu = group.addSubmenu(\"/com/openbravo/images/contents.png\", \"Menu.Maintenance.Reports\", \"com.openbravo.pos.forms.MenuStockManagement\");\n        submenu.addTitle(\"Menu.SalesManagement.Reports\");\n        submenu.addPanel(\"/com/openbravo/images/appointment.png\", \"Menu.AuditTrail\", \"/com/openbravo/reports/audittrail.bs\");\n        submenu.addPanel(\"/com/openbravo/images/appointment.png\", \"Menu.ShowCollection\", \"/com/openbravo/reports/showDetails.bs\");\n      submenu.addPanel(\"/com/openbravo/images/appointment.png\", \"Menu.TicketDetails\", \"/com/openbravo/reports/ticketDetails.bs\");\n\nsubmenu.addPanel(\"/com/openbravo/images/appointment.png\", \"Menu.RefundDetails\", \"/com/openbravo/reports/refundDetails.bs\");\n        submenu = group.addSubmenu(\"/com/openbravo/images/contents.png\", \"Menu.Maintenance\", \"com.openbravo.pos.forms.MenuMaintenance\");\n        submenu.addTitle(\"Menu.Maintenance.POS\");\n        submenu.addPanel(\"/com/openbravo/images/clipart.png\", \"Menu.Resources\", \"com.openbravo.pos.admin.ResourcesPanel\");\nsubmenu.addPanel(\"/com/openbravo/images/bookmark.png\", \"Menu.Floors\", \"com.openbravo.pos.mant.JPanelFloors\");\n        submenu.addPanel(\"/com/openbravo/images/bookmark.png\", \"Menu.Tables\", \"com.openbravo.pos.mant.JPanelPlaces\");\n// Deprecated options.\n//        submenu.addTitle(\"Menu.Maintenance.ERP\");\n//        submenu.addExecution(\"/com/openbravo/images/openbravo.png\", \"Menu.ERPProducts\", \"com.openbravo.possync.ProductsSyncCreate\");\n//        submenu.addExecution(\"/com/openbravo/images/openbravo.png\", \"Menu.ERPOrders\", \"com.openbravo.possync.OrdersSyncCreate\");\n    group = menu.addGroup(\"Menu.System\");\n    group.addChangePasswordAction();\n    group.addPanel(\"/com/openbravo/images/package_settings.png\", \"Menu.Configuration\", \"com.openbravo.pos.config.JPanelConfiguration\");\n    group.addPanel(\"/com/openbravo/images/fileprint.png\", \"Menu.Printer\", \"com.openbravo.pos.panels.JPanelPrinter\");\n    group.addExitAction();\n'),('15','Printer.CustomerPaid',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- \n    Openbravo POS is a point of sales application designed for touch screens.\n    Copyright (C) 2008-2009 Openbravo, S.L.\n    http://sourceforge.net/projects/openbravopos\n\n    This file is part of Openbravo POS.\n\n    Openbravo POS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    Openbravo POS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with Openbravo POS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n<output>\n    <display>\n        <line>\n            <text align=\"left\" length=\"10\">Total paid.</text>\n            <text align=\"right\" length=\"10\">${ticket.printTotalPaid()}</text>\n        </line>\n        <line>\n            <text align=\"center\" length=\"20\">Thank you.</text>\n        </line>\n    </display>\n    <ticket>\n        <image>Printer.Ticket.Logo</image>\n        <line></line>\n        <line>\n            <text align=\"center\" length=\"42\">Receipt sample.</text>\n        </line>\n        <line>\n            <text align=\"center\" length=\"42\">You can change this template</text>\n        </line>\n        <line>\n            <text align=\"center\" length=\"42\">in the resources panel</text>\n        </line>\n        <line></line>\n        <line>\n            <text align=\"left\" length=\"15\">Receipt:</text>\n            <text>${ticket.printId()}</text>\n        </line>    \n        <line>\n            <text align=\"left\" length=\"15\">Date:</text>\n            <text>${ticket.printDate()}</text>\n        </line>  \n         #if ($ticket.getCustomer())\n        <line>\n            <text align=\"left\" length=\"15\">Customer:</text>\n            <text>${ticket.getCustomer().printName()}</text>\n        </line>      \n        <line>\n            <text align=\"left\" length=\"15\"></text>\n            <text>${ticket.getCustomer().printTaxid()}</text>\n        </line>  \n        #end       \n        <line></line> \n        <line size=\"1\">\n            <text align =\"left\" length=\"16\" bold=\"true\">Total paid.</text>\n            <text align =\"right\" length=\"20\" bold=\"true\">${ticket.printTotalPaid()}</text>\n        </line>    \n        <line>\n            <text align =\"left\" length=\"16\" bold=\"true\">Pending.</text>\n            <text align =\"right\" length=\"20\" bold=\"true\">${customer.printCurDebt()}</text>\n        </line>          \n        #foreach ($paymentline in $ticket.payments)      \n        #if ($paymentline.name == \"cash\")\n        <line></line>     \n        <line>\n            <text bold=\"true\">Cash</text>\n        </line>  \n        <line>\n            <text align=\"left\" length=\"22\">Tendered:</text>\n            <text align =\"right\" length=\"20\">${paymentline.printPaid()}</text>\n        </line>  \n        <line>\n            <text align=\"left\" length=\"22\">Change:</text>\n            <text align =\"right\" length=\"20\">${paymentline.printChange()}</text>\n        </line>   \n        #end\n        #if ($paymentline.name == \"magcard\")\n        <line></line>        \n        <line>\n            <text bold=\"true\">Mag card</text>\n        </line>   \n        <line>\n            <text align =\"right\" length=\"42\">${paymentline.printTotal()}</text>\n        </line>    \n        <line>\n            <text align =\"left\" length=\"22\">Number:</text>\n            <text>${paymentline.printCardNumber()}</text>\n        </line>\n        <line>\n            <text align =\"left\" length=\"22\">Expiration date:</text>\n            <text>${paymentline.printExpirationDate()}</text>\n        </line>\n        <line>\n            <text align =\"left\" length=\"22\">Operation:</text>\n            <text>${paymentline.printTransactionID()}</text>\n        </line>\n        <line>\n            <text align =\"left\" length=\"22\">Authorization:</text>\n            <text>${paymentline.printAuthorization()}</text>\n        </line>\n        #end  \n        #if ($paymentline.name == \"cheque\")\n        <line></line>     \n        <line>\n            <text bold=\"true\">Cheque</text>\n        </line>    \n        <line>\n            <text align =\"right\" length=\"42\">${paymentline.printTotal()}</text>\n        </line>    \n        #end\n         #if ($paymentline.name == \"paperin\")\n        <line></line>     \n        <line>\n            <text bold=\"true\">Note</text>\n        </line>    \n        <line>\n            <text align =\"right\" length=\"42\">${paymentline.printTotal()}</text>\n        </line>    \n         #end\n        #end \n        <line></line>            \n        <line>\n            <text align=\"left\" length=\"15\">Cashier:</text>\n            <text>${ticket.printUser()}</text>\n        </line>\n        <line></line>            \n        <line>\n            <text align=\"center\" length=\"42\">Thank you for your visit.</text>\n        </line>    \n    </ticket>\n    #foreach ($paymentline in $ticket.payments)      \n    #if ($paymentline.name == \"cash\")\n    <opendrawer/>\n    #end\n    #if ($paymentline.name == \"cashrefund\")\n    <opendrawer/>\n    #end  \n    #end\n</output>\n'),('16','Printer.CustomerPaid2',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- \n    Openbravo POS is a point of sales application designed for touch screens.\n    Copyright (C) 2008-2009 Openbravo, S.L.\n    ht